DO $$
DECLARE

	/* Información de eventos	*/
	my_event_id event.id_event%TYPE;
	my_event_name event.name%TYPE;
	my_event_description event.description%TYPE;
	my_event_date_event event.date_event%TYPE;
	my_event_hour_event event.hour_event%TYPE;
	my_event_address event.address%TYPE;
	my_event_bookings event.bookings%TYPE;
	my_event_duration event.duration%TYPE;
	my_event_image_event event.image_event%TYPE;
	my_event_locality event.locality%TYPE;
	my_event_price event.price%TYPE;

   	my_location coworking.cw_location%TYPE;

   	my_date	TIMESTAMP;

BEGIN
    /*  Recuperamos la población del evento 1*/

    SELECT id_city INTO my_location FROM city where city =  'Triacastela';

	/*	Asignamos la fecha de partida de los datos actuales	*/
	SELECT CURRENT_DATE - INTERVAL '1 month' INTO my_date;

	/*	Asignamos los valores para el evento que vamos a crear	*/
	SELECT 	'Bingo Manolo','Ven a probar tu suerte al mejor bingo de Galicia','2025-02-28','12:00:00'
	INTO my_event_name, my_event_description, my_event_date_event, my_event_hour_event;

	SELECT 'Rúa Alcalde Juan Vidal', 50, 120, 10
	INTO my_event_address, my_event_bookings, my_event_duration, my_event_price;

	SELECT ''
	INTO my_event_image_event;

	/*	Creamos eventos para el usuario creado	*/
	INSERT INTO public."event" (id_event, "name", description, date_event, hour_event, address, bookings, usr_id, duration, image_event, locality, price)
	VALUES(nextval('event_id_event_seq'::regclass), my_event_name, my_event_description, my_event_date_event, my_event_hour_event, my_event_address, my_event_bookings, 3, my_event_duration, my_event_image_event,  my_location, my_event_price)
	RETURNING id_event into my_event_id;

	/*	Asignamos algunas reservas para el evento creado	*/
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 2, true);
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 3, true);

/*  Recuperamos la población del evento 2*/

    SELECT id_city INTO my_location FROM city where city =  'Triacastela';

	/*	Asignamos la fecha de partida de los datos actuales	*/
	SELECT CURRENT_DATE - INTERVAL '1 month' INTO my_date;

	/*	Asignamos los valores para el evento que vamos a crear	*/
	SELECT 	'Concierto de Angel Lopez','De la mano del famosisimo cantante Angel Lopez','2025-02-21','19:30:00'
	INTO my_event_name, my_event_description, my_event_date_event, my_event_hour_event;

	SELECT 'Polideportivo de Castela', 250, 120, 15
	INTO my_event_address, my_event_bookings, my_event_duration, my_event_price;

	SELECT ''
	INTO my_event_image_event;

	/*	Creamos eventos para el usuario creado	*/
	INSERT INTO public."event" (id_event, "name", description, date_event, hour_event, address, bookings, usr_id, duration, image_event, locality, price)
	VALUES(nextval('event_id_event_seq'::regclass), my_event_name, my_event_description, my_event_date_event, my_event_hour_event, my_event_address, my_event_bookings, 3, my_event_duration, my_event_image_event,  my_location, my_event_price)
	RETURNING id_event into my_event_id;

	/*	Asignamos algunas reservas para el evento creado	*/
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 2, true);
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 3, true);

/*  Recuperamos la población del evento 3*/

    SELECT id_city INTO my_location FROM city where city =  'Triacastela';

	/*	Asignamos la fecha de partida de los datos actuales	*/
	SELECT CURRENT_DATE - INTERVAL '1 month' INTO my_date;

	/*	Asignamos los valores para el evento que vamos a crear	*/
	SELECT 	'Concurso canino','Nos reunimos como todos los años para ver cual de nuestros compañeros caninos es el mejor','2025-02-28','17:00:00'
	INTO my_event_name, my_event_description, my_event_date_event, my_event_hour_event;

	SELECT 'Parque municipal de Triacastela', 20, 40, 0
	INTO my_event_address, my_event_bookings, my_event_duration, my_event_price;

	SELECT ''
	INTO my_event_image_event;

	/*	Creamos eventos para el usuario creado	*/
	INSERT INTO public."event" (id_event, "name", description, date_event, hour_event, address, bookings, usr_id, duration, image_event, locality, price)
	VALUES(nextval('event_id_event_seq'::regclass), my_event_name, my_event_description, my_event_date_event, my_event_hour_event, my_event_address, my_event_bookings, 3, my_event_duration, my_event_image_event,  my_location, my_event_price)
	RETURNING id_event into my_event_id;

	/*	Asignamos algunas reservas para el evento creado	*/
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 2, true);
	INSERT INTO public.booking_event (bke_event_id, bke_id_event, bke_usr_id, bke_event_state) VALUES(nextval('booking_event_bke_event_id_seq'::regclass), my_event_id, 3, true);

END $$;